import path from 'node:path';
import fs from 'node:fs';
import url from 'node:url';
import {imageSize as sizeOf} from 'image-size';
import {ImageUtils} from '../dist/build.mjs';

// Extract the directory portion of the URL.  This is the equivalent of __dirname in CommonJS.
const __dirname = path.dirname(url.fileURLToPath(import.meta.url));

const inputsDir = `${__dirname}/inputs`;
const outputsDir = `${__dirname}/outputs`;

describe('cropImage', () => {
  test('should crop an image successfully', async () => {
    const inputPath = path.join(inputsDir, 'node-mascot.jpg');
    const outputPath = path.join(outputsDir, 'cropped_image_valid_options.jpg');
    const options = {left: 108, top: 0, width: 299, height: 312};
    await ImageUtils.cropImage(inputPath, outputPath, options);
    const {width, height} = sizeOf(outputPath);
    expect(width).toBe(options.width);
    expect(height).toBe(options.height);
  });

  test('should handle negative crop offsets by setting them to 0', async () => {
    const inputPath = path.join(inputsDir, 'node-mascot.jpg');
    const outputPath = path.join(outputsDir, 'cropped_image_negative_offsets.jpg');
    const options = {left: -10, top: -20, width: 540, height: 562};
    await ImageUtils.cropImage(inputPath, outputPath, options);
    const {width, height} = sizeOf(outputPath);
    expect(width).toBe(options.width);
    expect(height).toBe(options.height);
  });
});

describe('mergeImages', () => {
  /**
   * Calculates the expected dimensions of merged images based on options.
   * @param {string[]} inputPaths Array of input image paths.
   * @param {object} options Options for merging images.
   * @return {{width: number, height: number}} Expected dimensions.
   */
  const calculateExpectedDimensions = (inputPaths, options = {}) => {
    let expectedWidth = 0;
    let expectedHeight = 0;
    const isHorizontal = options.direction === 'horizontal';
    for (const inputPath of inputPaths) {
      const {width, height} = sizeOf(inputPath);
      if (isHorizontal) {
        expectedWidth += width;
        expectedHeight = Math.max(expectedHeight, height);
      } else {
        expectedWidth = Math.max(expectedWidth, width);
        expectedHeight += height;
      }
    }
    if (options.margin) {
      const margins = typeof options.margin === 'string'
        ? options.margin.split(' ').map(Number)
        : [options.margin.top, options.margin.right, options.margin.bottom, options.margin.left];
      const [top = 0, right = top, bottom = top, left = right] = margins;
      if (isHorizontal) {
        expectedWidth += left + right + ((inputPaths.length - 1) * (options.offset || 0));
        expectedHeight += top + bottom;
      } else {
        expectedWidth += left + right;
        expectedHeight += top + bottom;
      }
    }
    return {width: expectedWidth, height: expectedHeight};
  }

  const inputPaths = [
    path.join(inputsDir, 'node-mascot.jpg'),
    path.join(inputsDir, 'node-mascot.jpg'),
  ];

  test('should merge images vertically with default options', async () => {
    const outputPath = path.join(outputsDir, 'merged_images_vertical.jpg');
    await ImageUtils.mergeImages(inputPaths, outputPath);
    const {width, height} = sizeOf(outputPath);
    const expectedDimensions = calculateExpectedDimensions(inputPaths);
    expect(width).toBe(expectedDimensions.width);
    expect(height).toBe(expectedDimensions.height);
  });

  test('should merge images horizontally with custom options', async () => {
    const outputPath = path.join(outputsDir, 'merged_images_horizontal_custom.jpg');
    const options = {
      direction: 'horizontal',
      color: 'red',
      align: 'center',
      offset: 10,
      margin: '20 30',
    };
    await ImageUtils.mergeImages(inputPaths, outputPath, options);
    const {width, height} = sizeOf(outputPath);
    const expectedDimensions = calculateExpectedDimensions(inputPaths, options);
    expect(width).toBe(expectedDimensions.width);
    expect(height).toBe(expectedDimensions.height);
  });

  test('should merge images vertically with object margin', async () => {
    const outputPath = path.join(outputsDir, 'merged_images_vertical_object_margin.jpg');
    const options = {
      margin: {top: 5, right: 10, bottom: 15, left: 20},
    };
    await ImageUtils.mergeImages(inputPaths, outputPath, options);
    const {width, height} = sizeOf(outputPath);
    const expectedDimensions = calculateExpectedDimensions(inputPaths, options);
    expect(width).toBe(expectedDimensions.width);
    expect(height).toBe(expectedDimensions.height);
  });
});

describe('resizeImage', () => {
  /**
   * Calculates expected output dimensions based on input dimensions and resize options.
   * @param {object} inputDimensions Input image dimensions.
   * @param {object} options Resize options.
   * @return {object} Expected output dimensions.
   */
  const calculateExpectedDimensions = (inputDimensions, options) => {
    if (options.width && options.height && options.contain)
      return {width: options.width, height: options.height};
    else if (options.width) {
      const height = Math.round(inputDimensions.height * options.width / inputDimensions.width);
      return {width: options.width, height};
    } else if (options.height) {
      const width = Math.round(inputDimensions.width * options.height / inputDimensions.height);
      return {width, height: options.height};
    }
    return inputDimensions; // default case
  }
  
  let inputPath;
  let inputDimensions;

  beforeEach(() => {
    inputPath = path.join(inputsDir, 'node-mascot.jpg');
    inputDimensions = sizeOf(inputPath);
  });

  test('should resize an image with width', async () => {
    const options = {width: 200, output: path.join(outputsDir, 'resized_image_width.jpg')};
    const expectedDimensions = calculateExpectedDimensions(inputDimensions, options);
    await ImageUtils.resizeImage(inputPath, options);
    const outputDimensions = sizeOf(options.output);
    expect(outputDimensions.width).toBe(expectedDimensions.width);
    expect(outputDimensions.height).toBe(expectedDimensions.height);
  });

  test('should resize an image with height', async () => {
    const options = {height: 200, output: path.join(outputsDir, 'resized_image_height.jpg')};
    const expectedDimensions = calculateExpectedDimensions(inputDimensions, options);
    await ImageUtils.resizeImage(inputPath, options);
    const outputDimensions = sizeOf(options.output);
    expect(outputDimensions.width).toBe(expectedDimensions.width);
    expect(outputDimensions.height).toBe(expectedDimensions.height);
  });

  test('should resize an image to fit within specified dimensions', async () => {
    const options = {
      width: 200,
      height: 150,
      contain: true,
      output: path.join(outputsDir, 'resized_image_contain.jpg'),
    };
    const expectedDimensions = calculateExpectedDimensions(inputDimensions, options);
    await ImageUtils.resizeImage(inputPath, options);
    const outputDimensions = sizeOf(options.output);
    expect(outputDimensions.width).toBe(expectedDimensions.width);
    expect(outputDimensions.height).toBe(expectedDimensions.height);
  });
});

describe('getGifFrameCount', () => {
  let gifPath;
  let jpgPath;

  beforeEach(() => {
    gifPath = path.join(inputsDir, 'rockman.gif');
    jpgPath = path.join(inputsDir, 'rockman.jpg');
  });

  test('should return the number of frames for a GIF', async () => {
    const frameCount = await ImageUtils.getGifFrameCount(gifPath);
    expect(frameCount).toBe(23);
  });

  test('should return 1 for a non-GIF image', async () => {
    const frameCount = await ImageUtils.getGifFrameCount(jpgPath);
    expect(frameCount).toBe(1);
  });

  test('should handle data URLs', async () => {
    const dataUrl = 'data:image/gif;base64,';
    const frameCount = await ImageUtils.getGifFrameCount(dataUrl);
    expect(frameCount).toBe(23);
  });

  test('should throw error if file does not exist', async () => {
    await expect(ImageUtils.getGifFrameCount('nonexistent.gif')).rejects.toThrow();
  });
});

describe('extractFirstGifFrame', () => {
  let inputPath;

  beforeEach(() => {
    inputPath = path.join(inputsDir, 'rockman.gif');
  });

  test('should extract the first frame of a GIF', async () => {
    const outputPath = path.join(outputsDir, 'rockman_first_frame.jpg');
    await ImageUtils.extractFirstGifFrame(inputPath, outputPath);
    expect(fs.existsSync(outputPath)).toBe(true); // Check if the file exists
  });

  test('should handle GIFs from data URLs', async () => {
    const outputPath = path.join(outputsDir, 'rockman_first_frame_from_dataurl.jpg');
    const dataUrl = 'data:image/gif;base64,';
    await ImageUtils.extractFirstGifFrame(dataUrl, outputPath);
    expect(fs.existsSync(outputPath)).toBe(true); // Check if the file exists
  });

  test('should throw error if file does not exist', async () => {
    await expect(ImageUtils.extractFirstGifFrame('nonexistent.gif')).rejects.toThrow();
  });
});

describe('getImageDimensions', () => {
  test('should return image dimensions', () => {
    const inputPath = path.join(inputsDir, 'node-mascot.jpg');
    const dimensions = ImageUtils.getImageDimensions(inputPath);
    expect(dimensions).toEqual({width: 698, height: 800});
  });
});

describe('convertImageFormat', () => {
  let inputPath;

  beforeEach(() => {
    inputPath = path.join(inputsDir, 'node-mascot.jpg');
  });

  test('should convert image format with default options', async () => {
    const outputPath = path.join(outputsDir, 'converted_image_default.png');
    const dataUrl = await ImageUtils.convertImageFormat(inputPath, outputPath);
    expect(dataUrl).toMatch(/^data:image\/png;base64,[a-zA-Z0-9+/=]+$/);
  });

  test('should convert image format with custom options', async () => {
    const inputPath = path.join(inputsDir, 'node-mascot.jpg');
    const outputPath = path.join(outputsDir, 'converted_image_custom.png');
    const options = {
      margin: 10,
      background: 'black',
    };
    const dataUrl = await ImageUtils.convertImageFormat(inputPath, outputPath, options);
    expect(dataUrl).toMatch(/^data:image\/png;base64,[a-zA-Z0-9+/=]+$/);
  });

  test('should handle GIFs correctly', async () => {
    const inputPath = path.join(inputsDir, 'rockman.gif');
    const outputPath = path.join(outputsDir, 'converted_image_gif.png');
    const dataUrl = await ImageUtils.convertImageFormat(inputPath, outputPath);
    expect(dataUrl).toMatch(/^data:image\/png;base64,[a-zA-Z0-9+/=]+$/);
  });

  test('should handle data URLs', async () => {
    const outputPath = path.join(outputsDir, 'converted_image_dataurl.png');
    const dataUrl = await ImageUtils.convertImageFormat('data:image/jpeg;base64,'
      , outputPath);
    expect(dataUrl).toMatch(/^data:image\/png;base64,[a-zA-Z0-9+/=]+$/);
  });

  test('should throw error if file does not exist', async () => {
    await expect(ImageUtils.convertImageFormat('nonexistent.jpg')).rejects.toThrow();
  });
});